insert into permission_role (permission_id, role_id) values (14, 7); // 14 là id rows vừa tạo của câu insert trên, 7 là id của quyền admin


Thêm config: key = config_keyword_link; value = 	
{"max_keyword": 3, "max_count_per_keyword": 3}

Đây là script chèn link:
`function addLink(keyword, link, linkQttyLimit) {
    // get all P-tag elements
    var elements = document.getElementsByTagName("p");
    var count = 0;
    var keywordRegex = new RegExp("\\b" + keyword + "\\b(?![^<]*?<\/a>)", "gi");
    for (let index = 0; index < elements.length; index++) {
        // build element props
        const element = elements[index];
        const position = element.getBoundingClientRect();
        const style = getComputedStyle(element);
        var positionY = position.y;
        var styleDisplay = style["display"];
        var curInnerHTML = element.innerHTML;
        // check element conditions
        if (positionY > 160
            && (styleDisplay == null || styleDisplay !== "none")
            && curInnerHTML.length > 20
        ) {
            // try to find the keyword in inner-HTML
            var matches = curInnerHTML.match(keywordRegex);
            if (matches != null && matches.length >= 1) {
                // add link to the keyword
                curInnerHTML = curInnerHTML.replace(keywordRegex, "<a style='text-decoration: underline' target='_blank' href='" + link + "'>$&</a>")
                element.innerHTML = curInnerHTML;
                count++;
                // check limit conditions
                if (linkQttyLimit != null && count >= linkQttyLimit) {
                    break;
                }
            }
        }
    }
    // return
    return count;
}`

